object Day05 extends App {
  val input = ""

  def react(polymer: String): String = {
    var stack = List.empty[Char]
    for (c <- polymer) {
      stack = c :: stack
      stack match {
        case a :: b :: tail if a!=b && a.toLower==b.toLower   => stack = tail
        case _ =>
      }
    }
    stack.reverse.mkString
  }

  val polymer1 = react(input)
  val part1 = polymer1.length
  println(part1)

  implicit class E_String(self: String) {
    def filterChar(c: Char) = self.filter(_.toLower != c)
  }

  val char2 = ('a' to 'z').minBy(c => react(polymer1.filterChar(c)).length)
  val polymer2 = react(polymer1.filterChar(char2))
  val part2 = polymer2.length
  println(part2)
}
